,id_continent:M,information_chatgpt:"\u003Cp\u003ETokelau je tichomořským ostrovním teritoriem, které se skládá z tří atolů a několika menších ostrůvků. Nachází se v jihozápadní části Tichomořského oceánu a je administrativně řízeno z Nového Zélandu. Ostrovy mají původní polynéskou kulturu a jsou známy svou krásnou přírodou a tichým, odpočinkovým prostředím.\u003C\u002Fp\u003E\n\u003Cp\u003ETokelau má pouze asi 1 400 obyvatel a cestování sem je poměrně náročné. Neexistuje zde letiště a návštěvníci sem musí cestovat lodí z ostrova Samoa. Avšak ti, kteří se rozhodnou navštívit Tokelau, budou odměněni krásnými bílými písečnými plážemi, tyrkysově modrou vodou a nádhernými korálovými útesy.\u003C\u002Fp\u003E\n\u003Cp\u003ETokelau je také známo svou tradiční kulturou a zvyky, jako je například taneční forma zvaná \"Faka Tokelau\", kterou místní tanečníci provádějí v barevných oblecích a doprovázeni bubny. Kromě toho jsou zde k dispozici různé turistické aktivity, jako jsou potápěčské výlety k nejlepším místům pro pozorování podmořského života a výlety na kole nebo pěší výlety na ostrovech.\u003C\u002Fp\u003E\n\u003Cp\u003EProtože Tokelau je poměrně malé území s omezenými zdroji, jsou zde nabízeny pouze základní turistické služby a infrastruktura. Návštěvníci by se měli připravit na to, že zde nenajdou luxusní hotely nebo velké nákupní centra, ale na druhé straně si užijí klid a odpočinek v krásné přírodě, daleko od každodenního ruchu velkých měst.\u003C\u002Fp\u003E",currency_code:gG,currency_name:lw,money_prices:[{name:u,value:b,date_update:a},{name:j,value:ao,date_update:a},{name:k,value:R,date_update:a},{name:l,value:H,date_update:a},{name:m,value:W,date_update:a},{name:n,value:P,date_update:a},{name:o,value:aa,date_update:a},{name:p,value:b,date_update:a},{name:q,value:b,date_update:a},{name:L,value:b,date_update:a},{name:r,value:R,date_update:a}],phone_numbers_emergency:b,phone_prefix:"+690",coordinates:[{latitude:AW,longitude:AX},{latitude:AW,longitude:AX}],people_